Actionscript.script:
攻击时移动 = _root.敌人二级函数.攻击时移动;
攻击时四向移动 = _root.敌人二级函数.攻击时四向移动;

function 光弹()
{
	var 子弹属性 = _root.子弹属性初始化(this.攻击点1);
	子弹属性.声音 = "airshoot.wav";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 10;
	子弹属性.发射效果 = "";
	子弹属性.子弹种类 = "精灵机导弹";
	子弹属性.子弹威力 = _parent.空手攻击力 * 3;
	子弹属性.伤害类型 = "魔法";
	子弹属性.魔法伤害属性 = "冲";
	子弹属性.子弹速度 = 40;
	子弹属性.击中地图效果 = "火花";
	子弹属性.Z轴攻击范围 = 50;
	子弹属性.击倒率 = 5;
	子弹属性.击中后子弹的效果 = "";
	_root.子弹区域shoot传递(子弹属性);
}

